INSERT INTO `product_meta_data` VALUES ('9ac8c9c2-1735-418b-b700-a1894a8965fd',1,'<ul>\n<li><span style=\"color: rgb(0, 0, 0);\"><strong>Polo Cot</strong>ton 42250</span> to najczęściej wybierany model polo z kolekcji Promostars. Popularność swoją zawdzięcza wysokiej gramaturze, bogatej kolorystyce oraz wysokiej jakości wykonaniu. Koszulka ta <span style=\"color: rgb(224, 62, 45);\">cechuje się starannym wykonaniem</span>, komfortem noszenia, klasycznym, prostym krojem oraz wysoką trwaością. Jest to produkt idealny do haftu komputerowego oraz znakowania innymi metodami. Polo to polecamy dla pracownik&oacute;w firm, bądź też jako <span style=\"background-color: rgb(45, 194, 107);\">koszulkę reklamową, promocyjną na r&oacute;żne okazje.😶</span></li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>Opis:<!-- pagebreak --></strong></p>\n<ul>\n<li>dzianina typu pique;</li>\n<li>płaski kołnierz z podw&oacute;jnymi strukturalnymi paskami;</li>\n<li>trzy guziki;</li>\n<li>rozcięcia na bokach wykończone taśmą wzmacniającą od wewnątrz;</li>\n<li>podw&oacute;jne szwy;</li>\n<li>taśma wzmacniająca kołnierz i ramiona</li>\n</ul>','Pollo COTTON 42250 GRANATOWA ROZM. XL ','koszulka, odzież, 42250, polo','pl','2023-12-06 15:08:10','2023-12-06 15:23:08',NULL);
